INSERT INTO public.evento (id, descricao, localizacao, datainicial,titulo, imagem_url, created_at, updated_at, criador_id, datafinal, link_mais_informacoes, destaque, categoria_id, tipo) VALUES ('bc332e79-a10a-4a6d-b3a3-f142a075c0ac', 'Música, alegria e descontração marcarão o encerramento das atividades de abertura do semestre 2023.1, para a comunidade do IC.', 'STI, UFBA', '2023-03-29 19:15:00', 'IC Jam', 'https://i.ibb.co/51jBMLc/3icjam.jpg', '2023-06-19 15:02:46.063875', '2023-06-19 15:02:46.063875', '0e054aed-fa26-4280-9145-077595002527', '2023-03-29 21:00:00', NULL, false, 'f4a6d7b9-2693-4256-bfad-f61152fef7ae', NULL);
INSERT INTO public.evento (id, descricao, localizacao, datainicial,titulo, imagem_url, created_at, updated_at, criador_id, datafinal, link_mais_informacoes, destaque, categoria_id, tipo) VALUES ('e485bc3b-f8bc-4003-b645-24f96712d935', 'A temática abordada baseia-se na ideia de que “o software é pop, software é tech, software é quase tudo”, por isso, é importante ter claro que sua construção impacta a vida das pessoas, desde os negócios até o bem-estar social.', 'PAF 1, Ondina', '2023-04-05 16:00:00', 'Construção do Software com uma Visão Social', 'https://i.ibb.co/Gpw4CPM/4constru.jpg', '2023-06-19 14:55:56.479', '2023-06-19 14:55:56.479', '0e054aed-fa26-4280-9145-077595002527', '2023-04-05 18:00:00', NULL, false, '38082397-dd7b-4e0e-8291-1cebf891aad4', NULL);
INSERT INTO public.evento (id, descricao, localizacao, datainicial,titulo, imagem_url, created_at, updated_at, criador_id, datafinal, link_mais_informacoes, destaque, categoria_id, tipo) VALUES ('eaca1bc5-3cdb-4d77-9675-cbb27f350367', 'Workshop de capacitação em TIC.', 'PAF 2, Ondina', '2023-07-10 12:30:00', 'Capacitação em TIC', 'https://i.ibb.co/SKKjCPW/8capacit.jpg', '2023-06-26 12:31:29.119446', '2023-06-26 12:31:29.119446', '0e054aed-fa26-4280-9145-077595002527', '2023-07-14 12:30:00', 'https://www.bitly.com/ufba-tomorrow-julho-form', true, 'e24922d7-6db2-4b39-b98b-1c481023419e', 'Capacitação');
INSERT INTO public.evento (id, descricao, localizacao, datainicial,titulo, imagem_url, created_at, updated_at, criador_id, datafinal, link_mais_informacoes, destaque, categoria_id, tipo) VALUES ('1badd46d-9620-48d3-89af-09a1a9ed5599', 'Se liga que o IC está com inscrições abertas para a capacitação em Programação Avançada e Visualização de Informação. O curso abordará o estudo da linguagem C++, e será totalmente prático, com a implementação de programas diversos, utilizando estruturas de dados, e bibliotecas disponíveis nesta linguagem. O pré-requisito é ter conhecimento em introdução à lógica de programação. 📝', 'PAF 2, Ondina', '2023-07-17 12:00:00', 'Programação avançada em C++', 'https://i.ibb.co/YpjTRYR/10tech.jpg', '2023-06-26 12:43:28.292', '2023-06-26 12:43:28.292', '0e054aed-fa26-4280-9145-077595002527', NULL, 'https://computacao.ufba.br/', false, 'e24922d7-6db2-4b39-b98b-1c481023419e', NULL);
INSERT INTO public.evento (id, descricao, localizacao, datainicial,titulo, imagem_url, created_at, updated_at, criador_id, datafinal, link_mais_informacoes, destaque, categoria_id, tipo) VALUES ('00dcbe48-0b5a-4ce4-b3f4-f207295ec6ae', 'O curso abordará uma visão geral dos princípios de Inteligência Artificial e algoritmos de Aprendizado de Máquina supervisionado para a aquisição automática de conhecimento em conjuntos de dados.', 'PAF 2, Ondina', '2023-04-18 03:00:00', 'Capacitação em Inteligência Artificial', 'https://i.ibb.co/vvmn21B/13ia.jpg', '2023-06-26 12:44:58.072', '2023-06-26 12:44:58.072', '0e054aed-fa26-4280-9145-077595002527', NULL, 'https://computacao.ufba.br/', false, 'e24922d7-6db2-4b39-b98b-1c481023419e', NULL);
INSERT INTO public.evento (id, descricao, localizacao, datainicial,titulo, imagem_url, created_at, updated_at, criador_id, datafinal, link_mais_informacoes, destaque, categoria_id, tipo) VALUES ('499abd82-531c-4689-b002-48e3dc3bd3ca', 'A capacitação será gratuita e realizada integralmente online, ministrada por professores e especialistas da área. Terá carga horária de 40 horas e serão abordados conceitos sobre as redes 5G, soluções, seu impacto e inovação social, aplicações práticas em diversas áreas, como redes veiculares, saúde, educação, agricultura e manufatura. 📚', 'PAF 2, Ondina', '2023-07-03 13:00:00', 'Capacitação em Redes 5G', 'https://i.ibb.co/93j7w1H/7r5g.jpg', '2023-06-26 12:27:11.046', '2023-06-26 12:27:11.046', '841e51dc-05da-46f8-92bc-254c79f2086c', '2023-07-06 15:00:00', 'https://computacao.ufba.br/', false, 'e24922d7-6db2-4b39-b98b-1c481023419e', NULL);
INSERT INTO public.evento (id, descricao, localizacao, datainicial,titulo, imagem_url, created_at, updated_at, criador_id, datafinal, link_mais_informacoes, destaque, categoria_id, tipo) VALUES ('8b5f5473-9671-4bf0-81c1-e13ce157deda', 'Temos visto uma verdadeira explosão de aplicativos de inteligência artificial, mas as previsões para os próximos anos são ainda mais otimistas. Isso principalmente pelo aumento do volume e da variedade de dados disponíveis e pela evolução das tecnologias de processamento computacional. Significa, com isso, que é factível produzir modelos capazes de analisar dados mais complexos e em grandes volumes de forma rápida e automática para disponibilizar informações precisas para uma gestão inovadora e disruptiva. Isso pode levar a empresa a identificar novas estratégias com riscos mínimos. ', 'PAF 2, Ondina', '2023-06-28 13:40:00', 'Debate sobre aprendizado de máquina', 'https://i.ibb.co/PZWmXQx/11am.jpg', '2023-06-26 12:39:45.736', '2023-06-26 12:39:45.736', 'dee86435-bb09-4b56-8cfb-0c5ba2008e7a', '2023-06-30 15:00:00', NULL, false, '4082d73e-78ad-4525-92df-9d77826bd440', NULL);
INSERT INTO public.evento (id, descricao, localizacao, datainicial,titulo, imagem_url, created_at, updated_at, criador_id, datafinal, link_mais_informacoes, destaque, categoria_id, tipo) VALUES ('1aed2dba-1d91-4527-acb2-99c87f00399b', 'O debate tem como objetivo analisar e discutir com a comunidade UFBA um dos assuntos mais polêmicos do presente: as Tecnologias da Informação e da Comunicação.', 'PAF 1, Ondina', '2023-05-08 19:00:00', 'TICs e seus impactos na sociedade', 'https://i.ibb.co/dBs12H0/2ticimpct.jpg', '2023-06-19 14:52:49.836', '2023-06-19 14:52:49.836', '0e054aed-fa26-4280-9145-077595002527', '2023-05-08 21:00:00', NULL, false, '4082d73e-78ad-4525-92df-9d77826bd440', NULL);
